import React, { useEffect, useState, useContext } from 'react';
import Product from './Product';
import { AppContext } from '../context/AppContext';

const ProductList = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const { state } = useContext(AppContext);

  useEffect(() => {
    let isMounted = true;

    const fetchProducts = async () => {
      try {
        setLoading(true);
        const response = await fetch(
          `${process.env.REACT_APP_API_URL}/api/products/featured`,
          {
            headers: {
              'Content-Type': 'application/json',
              Authorization: state.userInfo ? `Bearer ${state.userInfo.token}` : '',
            },
          }
        );
        
        const data = await response.json();
        
        if (isMounted) {
          if (response.ok) {
            // Ensure countInStock exists for each product
            const normalizedProducts = Array.isArray(data) 
              ? data.map(p => ({
                  ...p,
                  countInStock: p.countInStock ?? p.stock ?? 0
                }))
              : [];
            setProducts(normalizedProducts);
          } else {
            setError(data.message || 'Failed to fetch products');
          }
          setLoading(false);
        }
      } catch (err) {
        if (isMounted) {
          setError(err.message);
          setProducts([]);
          setLoading(false);
        }
      }
    };

    fetchProducts();

    return () => { isMounted = false };
  }, [state.userInfo]);

  if (loading) return <div className="text-center my-5">Loading...</div>;
  if (error) return <div className="alert alert-danger">{error}</div>;

  return (
    <div className="container my-4">
      <h2 className="mb-4">Featured Products</h2>
      <div className="row">
        {products.length > 0 ? (
          products.map((product) => (
            <div key={product._id} className="col-md-4 col-lg-3 mb-4">
              <Product product={product} />
            </div>
          ))
        ) : (
          <div className="col-12">
            <p>No featured products available</p>
          </div>
        )}
      </div>
     <style>{`
  /* === Featured Products Container === */
  .featured-products-container {
    padding: 4rem 2rem;
    background: linear-gradient(to bottom, #f8fafc 0%, #ffffff 100%);
    position: relative;
    overflow: hidden;
  }

  /* === Section Header === */
  .section-header {
    text-align: center;
    margin-bottom: 3rem;
  }

  .section-title {
    font-size: 2.5rem;
    font-weight: 700;
    color: #1a3a4a;
    margin-bottom: 1rem;
    position: relative;
    display: inline-block;
  }

  .section-title::after {
    content: '';
    position: absolute;
    bottom: -10px;
    left: 50%;
    transform: translateX(-50%);
    width: 80px;
    height: 4px;
    background: linear-gradient(90deg, #22c9be, #1aa89f);
    border-radius: 2px;
    box-shadow: 0 2px 8px rgba(34, 201, 190, 0.3);
  }

  /* === Product Grid === */
  .product-grid {
    display: grid;
    grid-template-columns: repeat(auto-fill, minmax(280px, 1fr));
    gap: 2rem;
    max-width: 1200px;
    margin: 0 auto;
  }

  /* === Product Card === */
  .product-card {
    background: white;
    border-radius: 16px;
    overflow: hidden;
    box-shadow: 0 10px 25px rgba(0, 0, 0, 0.05);
    transition: all 0.4s cubic-bezier(0.16, 1, 0.3, 1);
    border: 1px solid rgba(0, 0, 0, 0.03);
  }

  .product-card:hover {
    transform: translateY(-8px);
    box-shadow: 0 15px 35px rgba(34, 201, 190, 0.15);
    border-color: rgba(34, 201, 190, 0.2);
  }

  .product-image-container {
    height: 200px;
    background: #f5f5f5;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 2rem;
  }

  .product-image {
    max-width: 100%;
    max-height: 100%;
    object-fit: contain;
    transition: transform 0.8s cubic-bezier(0.16, 1, 0.3, 1);
  }

  .product-card:hover .product-image {
    transform: scale(1.05);
  }

  .product-content {
    padding: 1.5rem;
  }

  .product-title {
    font-size: 1.25rem;
    font-weight: 600;
    color: #1a3a4a;
    margin-bottom: 0.5rem;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
  }

  .product-description {
    color: #6b7280;
    font-size: 0.9rem;
    margin-bottom: 1rem;
    height: 20px;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
  }

  .product-price {
    font-size: 1.5rem;
    font-weight: 700;
    color: #22c9be;
    margin-bottom: 1.5rem;
  }

  .product-actions {
    display: flex;
    gap: 1rem;
  }

  .add-to-cart {
    flex: 1;
    background: linear-gradient(135deg, #22c9be, #1aa89f);
    color: white;
    border: none;
    padding: 0.75rem;
    border-radius: 8px;
    font-weight: 600;
    cursor: pointer;
    transition: all 0.3s ease;
  }

  .add-to-cart:hover {
    transform: translateY(-2px);
    box-shadow: 0 4px 12px rgba(34, 201, 190, 0.3);
  }

  .edit-product {
    background: white;
    color: #22c9be;
    border: 1px solid #22c9be;
    padding: 0.75rem;
    border-radius: 8px;
    font-weight: 600;
    cursor: pointer;
    transition: all 0.3s ease;
  }

  .edit-product:hover {
    background: rgba(34, 201, 190, 0.1);
    transform: translateY(-2px);
  }

  /* === Responsive Adjustments === */
  @media (max-width: 768px) {
    .featured-products-container {
      padding: 3rem 1.5rem;
    }
    
    .section-title {
      font-size: 2rem;
    }
    
    .product-grid {
      grid-template-columns: repeat(auto-fill, minmax(240px, 1fr));
    }
  }

  @media (max-width: 576px) {
    .featured-products-container {
      padding: 2rem 1rem;
    }
    
    .section-title {
      font-size: 1.8rem;
    }
    
    .product-grid {
      grid-template-columns: 1fr;
    }
    
    .product-actions {
      flex-direction: column;
    }
  }
`}</style>
    </div>
  );
};

export default ProductList;
